import sys

def main():
    x, y, z = map(int, sys.stdin.readline().split())
    a, b, c = map(int, sys.stdin.readline().split())

    if a < x or b < y or c < z:
        print("NO")
    else:
        print("YES")

if __name__ == "__main__":
    main()

